import { Navigate, useLocation } from "react-router-dom"

const RequireAuth = ({children}) => {
    const location = useLocation();
    const auth = false;

    if (!auth) {
        return <Navigate to='/login' state={{from: location.state}}/>
    }

    return children;
}

export {RequireAuth}
